import System.IO (hFlush, stdout)

quicksort::(Ord a)=>[a]->[a]
quicksort lst = quicksort_rec lst (\x->x) []

quicksort_rec::(Ord a)=>[a]->([a]->[a])->[a]->[a]
quicksort_rec [] cont acc = cont acc
quicksort_rec (x:[]) cont acc = cont (x:acc)
quicksort_rec (x:lst) cont acc = let
        (lessers, greaters) = foldl place ([], []) lst
        place (f, s) ele
            | ele < x   = (ele:f, s)
            | otherwise = (f, ele:s)
    in quicksort_rec greaters (\l->(quicksort_rec lessers cont acc++(x:l))) acc
