quicksorta::(Ord a)=>[a]->[a]
quicksorta lst = quicksort_reca lst [] (\x->x)

quicksort_reca::(Ord a)=>[a]->[a]->([a]->[a])->[a]
quicksort_reca [] acc cont = cont acc
quicksort_reca (x:[]) acc cont = cont (x:acc)
quicksort_reca (x:lst) acc cont = let 
        lessers  = filter (<x) lst
        greaters = filter (>=x) lst
    in quicksort_reca greaters acc (\newAcc->(quicksort_reca lessers (x:newAcc) cont))
